import { ButtonPrimary } from "../../../shared/components/buttons/ButtonPrimary";
import { useEffectLogin } from "../../hooks/login.hooks";
import { handleSubmit } from "./Form.component";
export const FormHtml = () => {
  useEffectLogin();
  return (
    <div className="container">
      <div className="row">
        <h1>hello Wolrd</h1>
      </div>
      <ButtonPrimary
        icon="pi pi-check"
        iconsPos="left"
        label="Save"
        handleClick={handleSubmit}
      />
    </div>
  );
};
